import React from "react";

export const Quote = () => {
  const quoteFetch = async () => {
    const quote = await fetch("https://zenquotes.io/api/quotes/");
    const data = await quote.json();
    console.log(data);
  };
  return <div className="quote-container">
    <h2>QUOTE OF THE DAY</h2>
    </div>;
};
